import React, { Component } from 'react'
import { Row, Col, Table, Button, FormControl, FormGroup } from "react-bootstrap"
import './Registration.css'

export class Registration extends Component {
    constructor (props) {
        super(props);

        this.state = {
            patients: [
                {
                    FirstName: 'John',
                    LastName: 'Doe',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    StreetAddress: '248 Spruce Street',
                    City: 'Baltimoreland',
                    State: 'Maryland',
                    ZipCode: 32194
                },
                {
                    FirstName: 'Jamie',
                    LastName: 'Friend',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    StreetAddress: '248 Spruce Street',
                    City: 'Baltimoreland',
                    State: 'Maryland',
                    ZipCode: 32194
                }
            ],

            newPatient: {
                FirstName: '',
                LastName: '',
                NPI: 0,
                PhoneNumber: '',
                StreetAddress: '',
                City: '',
                State: '',
                ZipCode: 0
            },

        }
    }

    renderPatient (patient, index) {
        return (
            <tr key={index}>
                <td>{ patient.FirstName }</td>
                <td>{ patient.LastName }</td>
                <td>{ patient.NPI }</td>
                <td>{ patient.PhoneNumber }</td>
                <td>
                    { patient.StreetAddress } <br />
                    { patient.City } <br />
                    { patient.State } <br />
                    { patient.ZipCode }
                </td>
            </tr>
        )
    }


    onFormChange (input, field) {
        console.log(input);
        console.log(field);
        switch (field) {
            case 'firstName': {
                this.newPatient.FirstName = input;
                break;
            }

            case 'lastName': {
                this.newPatient.LastName = input;
                break;
            }

            case 'npi': {
                this.newPatient.NPI = input;
                break;
            }

            case 'phone': {
                this.newPatient.PhoneNumber = input;
                break;
            }

            case 'email': {
                this.newPatient.email = input;
                break;
            }

            case 'streetAddress': {
                this.newPatient.StreetAddress = input;
                break;
            }

            case 'city': {
                this.newPatient.City = input;
                break;
            }

            case 'state': {
                this.newPatient.State = input;
                break;
            }

            case 'zip': {
                this.newPatient.Zip = input;
                break;
            }
        }

    }

    handleSubmit (event) {
        this.patients.push(this.newPatient);
        this.patients.map(this.renderPatient());
    }

    render () {
        return (
            <div>
                <form onSubmit={this.handleSubmit} className="reg-form" >
                    <h1>Availity Patient Registration</h1>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='4' controlId='validationFormik01'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='firstName'
                                    placeholder="Enter First Name"
                                    value={this.state.newPatient.FirstName}
                                    onChange={e => this.onFormChange(e.target.value, 'firstName')}
                                />
                        </FormGroup>
                        <FormGroup as={Col} md='4' controlId='validationFormik02'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='lastName'
                                    placeholder="Enter Last Name" 
                                    value={this.state.newPatient.LastName}
                                    onChange={e => this.onFormChange(e.target.value, 'lastName')}
                                />
                        </FormGroup>
                        <FormGroup as={Col} md='4' controlId='validationFormik03'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='npi'
                                    placeholder="Enter NPI #" 
                                    value={this.state.newPatient.NPI}
                                    onChange={e => this.onFormChange(e.target.value, 'npi')}
                                />
                        </FormGroup>
                    </Row>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='6' controlId='validationFormik04'>
                                <FormControl 
                                        className='form-input'
                                        type="text"
                                        name='phoneNumber'
                                        placeholder="Enter Phone #" 
                                        value={this.state.newPatient.PhoneNumber}
                                        onChange={e => this.onFormChange(e.target.value, 'phone')}
                                    />
                        </FormGroup>
                        <FormGroup as={Col} md='6' controlId='validationFormik05'>
                                <FormControl 
                                    className='form-input'
                                    type="text"
                                    name='emailAddress'
                                    placeholder="Enter Email Address"
                                    value={this.state.newPatient.Email}
                                    onChange={e => this.onFormChange(e.target.value, 'email')}
                                />
                        </FormGroup>
                    </Row>
                    <Row className='mb-3'>
                        <FormGroup as={Col} md='3' controlId='validationFormik06'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='streetAddress'
                                placeholder="Enter Street Address" 
                                value={this.state.newPatient.StreetAddress}
                                onChange={e => this.onFormChange(e.target.value, 'streetAddress')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik07'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='city'
                                placeholder="Enter City" 
                                value={this.state.newPatient.City}
                                onChange={e => this.onFormChange(e.target.value, 'city')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik08'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='state'
                                placeholder="Enter State"
                                value={this.state.newPatient.State}
                                onChange={e => this.onFormChange(e.target.value, 'state')}
                            />
                        </FormGroup>
                        <FormGroup as={Col} md='3' controlId='validationFormik09'>
                            <FormControl 
                                className='form-input'
                                type="text"
                                name='zipCode'
                                placeholder="Enter Zip"
                                value={this.state.newPatient.ZipCode}
                                onChange={e => this.onFormChange(e.target.value, 'zip')}
                            />
                        </FormGroup>
                    </Row>
                    <Button type='submit'>Submit</Button>
                </form>
                <Table striped bordered hover size='sm' className='patients-tbl'>
                    <thead>
                        <tr>
                            <th>First Name</th>
                            <th>Last Name</th>
                            <th>NPI #</th>
                            <th>Phone Number</th>
                            <th>Business Address</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.patients.map(this.renderPatient)}
                    </tbody>
                </Table>
            </div>
        )
    }
}
